import React from "react";
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import OfficeMan from "./components/OfficeMan";



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          {/* <Route exact path="/" element={<HomePage />} /> */}
          <Route path="/" element={<OfficeMan />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
